import './App.css';

function App() {
  return (
    <>
   <div className="container">
    <nav>
      <div><img src="src/img/logo.png" alt="error" /></div>
        <ul>
          <li>Home</li>
          <li>About Us</li>
          <li>Our Services</li>
          <li>Testimonials</li>
          <li>Blogs</li>
          <li>Dropdown <span></span></li>
          <li>Contact</li>
          </ul>
    </nav>
   </div>
    </>
  );
}

export default App;
